    internal InnerAnomalyDetectorRDSSourceConfigFactory RDSSourceConfigFactory { get; set; }

    internal InnerAnomalyDetectorAppFlowConfigFactory AppFlowConfigFactory { get; set; }

    internal InnerAnomalyDetectorRedshiftSourceConfigFactory RedshiftSourceConfigFactory { get; set; }

    protected override Humidifier.LookoutMetrics.AnomalyDetectorTypes.MetricSource Create()
    {
        var metricSourceResult = CreateMetricSource();
        factoryAction?.Invoke(metricSourceResult);

        return metricSourceResult;
    }

    private Humidifier.LookoutMetrics.AnomalyDetectorTypes.MetricSource CreateMetricSource()
    {
        var metricSourceResult = new Humidifier.LookoutMetrics.AnomalyDetectorTypes.MetricSource();

        return metricSourceResult;
    }
    public override void CreateChildren(Humidifier.LookoutMetrics.AnomalyDetectorTypes.MetricSource result)
    {
        base.CreateChildren(result);

        result.S3SourceConfig ??= S3SourceConfigFactory?.Build();
        result.CloudwatchConfig ??= CloudwatchConfigFactory?.Build();
        result.RDSSourceConfig ??= RDSSourceConfigFactory?.Build();
        result.AppFlowConfig ??= AppFlowConfigFactory?.Build();
        result.RedshiftSourceConfig ??= RedshiftSourceConfigFactory?.Build();
    }

} // End Of Class

